unsigned short econv_from_jis_to_sjis(unsigned short jis)
{
    unsigned char c1 = (jis >> 8) & 0xff;
    unsigned char c2 = jis & 0xff;
    
    /* 第１バイトの奇数偶数で第２バイトを２組に分け処理する */
    if (c1 & 1) {
	c2 += 0x1F;
	if (c2 >= 0x7F) {
	    c2++;
	}
    } else {
	c2 += 0x7E;
    }
    c1 = (c1 - ' ' - 1) / 2 + 0x81;
    if (c1 >= 0xA0) {
	c1 += '@';
    }
    return c1 * 0x100U + c2;
}

unsigned short econv_from_utf8_to_utf16(unsigned char* utf8,int* len)
{
    unsigned short utf16;

    if(*utf8 < 0x80){
	utf16 = *utf8;
	*len = 1;
    } else {
	utf16  = ((*(utf8++) & 0x0f) << 4) << 8;
	utf16 |= ((*utf8 & 0x3c) >> 2) << 8;
	utf16 |= ((*(utf8++) & 0x03) << 6);
	utf16 |= (*(utf8++) & 0x3f);
	*len = 3;
    }

    return(utf16);
}

